import React, { Component } from 'react';

class Sidebar extends Component {
    handleCheck(e) {
        debugger;
    }
    render() {
        return (
            <React.Fragment>
                <div className="sidebar-div">
                    <ul class="nav flex-column">
                        <li class="nav-item nav-quote-req">
                            <a class="nav-link active" href="#" onClick={() => this.handleCheck()} data-id="1"></a>
                        </li>
                        <li class="nav-item nav-workers">
                            <a class="nav-link" href="../"></a>
                        </li>
                        <li class="nav-item nav-mail">
                            <a class="nav-link" href="#"></a>
                        </li>
                        <li class="nav-item nav-test">
                            <a class="nav-link" href="#"></a>
                        </li>
                        <li class="nav-item nav-inventory">
                            <a class="nav-link" href="#"></a>
                        </li>
                        <li class="nav-item nav-operations">
                            <a class="nav-link" href="#"></a>
                        </li>
                        <li class="nav-item nav-projects">
                            <a class="nav-link" href="../Dashboard"></a>
                        </li>

                    </ul>
                </div>
            </React.Fragment>
        );
    }
}
export default Sidebar;
